type Matrix struct {
	N int64
	A []int64
}

Function Implementations:
func (m Matrix) Get(i int64, j int64) int64 {
	return m.A[i*m.N+j]
}

func max(a, b int64) int64 {
	if a > b {
		return a
	}
	return b
}

func initH(g *Matrix) (e *Env) {
	var i, j int64
	e = newEnv(g.N)
	e.G = g
	e.N = g.N
	for i = 0; i < e.N; i++ {
		for j = 0; j < e.N; j++ {
			e.Lx[i] = max(e.Lx[i], e.G.Get(i, j))
		}
	}
	return e
}
